def pull_image_url(markerid):
    siteid = markerid.split("_")[1]
    rx = r"javaimgsrc = \"(.+)\""
    r = requests.get(f"https://www.mdottraffic.com/mapbubbles/camerasite.aspx?site={siteid}")
    m = re.search(rx,r.text)
    if m:
        return m.group(1)
    else:
        return ""

def list_cameras():
    for camera in cameras["d"]:
        yield {"description": camera["tooltip"], "geo": [camera["lat"],camera["lon"]], "id": camera["markerid"], "format": pull_image_url(camera["markerid"])}